<div data-component-name="KernelViewer" style="display: flex; flex-direction: column; flex: 1 0 auto;"></div><script>var Kaggle=window.Kaggle||{};Kaggle.State=Kaggle.State||[];Kaggle.State.push({"kernel":{"id":81210,"title":"Titanic survival prediction","forkParent":null,"currentRunId":307251,"mostRecentRunId":307254,"url":"/chemjong/titanic-survival-prediction","tags":[],"commentCount":0,"upvoteCount":1,"viewCount":286,"forkCount":0,"bestPublicScore":null,"author":{"id":616369,"displayName":"Scottish Chemjong","email":null,"editedEmail":null,"editedEmailCode":null,"userName":"chemjong","thumbnailUrl":"https://storage.googleapis.com/kaggle-avatars/thumbnails/616369-gr.jpg","profileUrl":"/chemjong","registerDate":"0001-01-01T00:00:00Z","lastVisitDate":"0001-01-01T00:00:00Z","statusId":0,"performanceTier":1,"userRoles":null,"userLogins":null,"groupIds":null,"duplicateUsers":null,"hasPhoneVerifications":false,"failedNerdchas":0,"hasPendingNerdcha":false,"deleteRequests":null,"userAttributes":null,"isAdmin":false,"isTvc":false,"isKaggleBot":false,"isAdminOrTvc":false,"isAnonymous":false,"canAct":false,"canBeSeen":false,"thumbnailName":null,"activationCode":"00000000-0000-0000-0000-000000000000","isPhoneVerified":false},"isPrivate":false,"updatedTime":"2016-07-23T08:07:44.5766667Z","selfLink":"/kernels/81210","pinnedDockerImageVersionId":null,"isLanguageTemplate":false,"medal":null,"topicId":null,"readGroupId":null,"writeGroupId":null,"slug":"titanic-survival-prediction"},"kernelBlob":{"id":7948280,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"script","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"\n# This R script will run on our backend. You can write arbitrary code here!\n\n# Many standard libraries are already installed, such as randomForest\nlibrary(randomForest)\nlibrary(dplyr)\nlibrary(ggplot2)\nlibrary(VIM)\nlibrary(stringr)\nlibrary(\u0022ggthemes\u0022)\nlibrary(\u0022randomForest\u0022)\nlibrary(\u0022ROCR\u0022)\nlibrary(\u0022mice\u0022)\nlibrary(\u0027scales\u0027)\n# The train and test data is stored in the ../input directory\ntrain \u003c- read.csv(\u0022../input/train.csv\u0022, stringsAsFactors=F)\ntest  \u003c- read.csv(\u0022../input/test.csv\u0022, stringsAsFactors=F)\n\nglimpse(train)\nglimpse(test)\n\n#############################\n#When column-binding, rows are matched by position,\n#not value so all data frames must have the same number of rows.\n#To match by value, not position, see left_join etc. When row-binding,\n#columns are matched by name, and any values that don\u0027t \n#match will be filled with NA\n##############################\n\ndata1\u003c-bind_rows(train, test)\n\n##data1$Survived[is.na(data1$Survived)]\u003c-0\n\nvisual_na\u003c- aggr(data1, numbers=TRUE, labels=names(data1),cex.axis=.5, cex.numbers=.5, sortVars=T)\n\n##############\n#ok there is lot of NA in Cabin \u0026 Deck\n#whats going on\n##############\n\ndata1$Cabin[data1$Cabin==\u0027\u0027]\u003c-NA\nsum(is.na(data1$Cabin))\n\nstr(data1)\n\n#############\n#So we given 0 for all test$Survived\n#meaning they are all dead\n###############\n\n#############\n#ok lets tackkle names\n#I find 2 things interest\n#their surname \u0026\n#their title\n##############\n\n#############\n#ok first lets extract\n#title from their names\n#############\n\n\ndata1$Title \u003c- gsub(\u0027(.*,)|(\\\\..*)\u0027, \u0027\u0027, data1$Name)\ndata1$Title\u003c-str_trim(data1$Title)\n\ndistinct(data1, Title)\n\n################\n#Ok we have 19 distinct Titles\n################\n\ndata1$Title \u003c- gsub(\u0027Ms\u0027, \u0027Miss\u0027, data1$Title, ignore.case = T)\n\ndata1$Title \u003c- gsub(\u0027Mlle\u0027, \u0027Miss\u0027, data1$Title, ignore.case = T)\n\nno_title \u003c- c(\u0027Master\u0027, \u0027Don\u0027, \u0027Rev\u0027, \u0027Dr\u0027, \u0027Mme\u0027, \u0027Major\u0027, \u0027Lady\u0027, \u0027Sir\u0027, \u0027Col\u0027, \u0027Capt\u0027, \u0027the Countess\u0027, \u0027Jonkheer\u0027, \u0027Dona\u0027)\n\ndata1$Title[data1$Title %in% no_title]\u003c-\u0027No Title\u0027\n\ndistinct(data1, Title)\n####################\n#ok we have now only 4\n#titles\n###################\n\ndata1$Surname \u003c- sapply(data1$Name, function(x) strsplit(x,\u0027[,.]\u0027 )[[1]][1])\n\n#################\n#lets sort out guy without fare\n#since only 1 person in all data with no fare\n#################\n\n\nfilter(data1, is.na(Fare))\n\n\n\nstr(data1)\n\ndata1$Cabin_class \u003c- sapply(data1$Cabin, function(x) substr(x, 1,1)[[1]][1])\n\n#################\n#this dude has fare value missing but we know he has Pclass 3 \u0026\n# Embarked from S\n################\n\ndistinct(data1, Embarked)\n\n#################################\n#Hist doest work; \n###ggplot(filter(data1, Pclass==3 \u0026 Embarked==\u0027S\u0027), aes(Fare))+geom_histogram(bins=20, na.rm = T)+\n ##       geom_vline(aes(xintercept=mean(Fare, na.rm=T)))+\n ###       scale_x_continuous(labels=dollar_format())\n#####################################\n\nggplot(filter(data1, Pclass==3 \u0026 Embarked==\u0027S\u0027), aes(Fare))+\n        geom_density(fill=\u0027green\u0027, alpha=.5)+\n        scale_x_continuous(labels=dollar_format(),breaks = c(0,10,20,30,40,50,60,70))+\n        geom_vline(aes(xintercept=median(Fare, na.rm=TRUE)), color=\u0027red\u0027, linetype=\u0027dashed\u0027)\n\ndata1[is.na(data1$Fare),]\n#####################\n# so now we can confirm row no. 1044 matches passenger ID\n#so safe to use code below\n####################\n\ndata1[is.na(data1$Fare),]$Fare\u003c- median(data1[data1$Pclass==3 \u0026 data1$Embarked==\u0027S\u0027,]$Fare, na.rm=TRUE)\n\ndata1[1044,]\n\nsum(is.na(data1$Embarked))\nglimpse(data1)\nsummary(as.factor(data1$Embarked))\n\n#####################\n#I should have made empty cells all NA in the beginning\n# anyways here we go\n######################\n\ndata1[data1==\u0027\u0027] \u003c-NA\n\n#####################\n#Now we can clearly see NAs in Embarked\n####################\n\nfilter(data1, is.na(Embarked))\n\n######################\n#2 girls with no Embarked value but they have Fare and Cabin_class common\n#####################\n\nggplot(data1, aes(Embarked, Fare))+geom_boxplot()+geom_hline(aes(yintercept=80), col=\u0022red\u0022, linetype= \u0027dashed\u0027, lwd=.5)+\n        facet_grid(~Pclass)+theme_bw()\n\nmedian(data1[data1$Embarked==\u0027C\u0027 \u0026 data1$Pclass==1,]$Fare, na.rm = T)\n\n###################\n# the median Fare for people with Pclass 1 with Embarked C is $77 which is close to what\n# those two girls payed \n#based on those estimates I think they embarked from C\n###################\n\ndata1[data1$PassengerId==62 | data1$PassengerId==830,]$Embarked\u003c- \u0027C\u0027\ndata1[data1$PassengerId==62 | data1$PassengerId==830,]\n\n\n\n########################\n#lets look at family size\n#sibsp           Number of Siblings/Spouses Aboard\n#parch           Number of Parents/Children Aboard\n#so combing those 2 will give us family size\n#########################\n\ndata1$Family_size \u003c-data1$SibSp+data1$Parch+1\n\n\n#######################\n#now we got many Age with NA almost 20 % of all age\n#\u0026 lots of Cabin_class with NAs\n# we need strong statistical inference method to predict those values\n##########################\n\n\n##all age variable from test data only\n\nstr(data1)\n\ndata1$Sex \u003c- as.factor(data1$Sex)\ndata1$Ticket \u003c-as.factor(data1$Ticket)\ndata1$Title \u003c-as.factor(data1$Title)\ndata1$Embarked \u003c-as.factor(data1$Embarked)\ndata1$Survived \u003c-as.factor(data1$Survived)\ndata1$Pclass \u003c-as.factor(data1$Pclass)\ndata1$Family_size \u003c-as.factor(data1$Family_size)\n################################\n####library(help=\u0022datasets\u0022) \n#see all inbuilt datasets for future reference\n#################################\n\n\n\n############################################################################################\n\n#train_data \u003c- data1[1:891,]\n#test_data \u003c- data1[892:1309,]\n#test_data$Survived\u003c-NA\n\n###################\n\n\n##########################################################################################\n\nsum(is.na(data1$Age))\n##263 NAs \n\n########################\n#lets explore whats going on with age \n########################\n\nhist(data1$Age, na.rm=T , freq=F)\nsummary(data1$Age)\n\n####how can age be 0\n\ndata1 %\u003e% filter(Age\u003c0)\n\n##############\n#ok its all good\n#############\n\n\nsummary(data1)\n#################\n#lets explore fare of $0\n################\n\ndata1 %\u003e% filter(Fare\u003c5)\n\ndata1[data1$Fare\u003c5,]\n\ndistinct(data1, Ticket)\nggplot(data1[1:418,], aes(Embarked, Fare))+geom_boxplot()\n\n\ntrain %\u003e% group_by(Embarked, Pclass) %\u003e% summarise(median(Fare))\n\n#####################################::::::::::::::::\n#ok lots of $0 Fare\n#we\u0027ll save this work for later\n######################################:::::::::::::::\n\nvisual_na2\u003c- aggr(data1[892:1309,], numbers=TRUE, labels=names(data1),cex.axis=.5, cex.numbers=.5, sortVars=T)\n\n\n\n\nage_pred \u003c- lm(Age~Fare+Sex+Pclass, data=data1[!is.na(data1$Age),])\nage_pred\nsummary(age_pred)\n\n#train_data$Age[is.na(train_data$Age)] \u003c- predict(age_pred, train_data)[is.na(train_data$Age)]\n#train_data$Age \u003c- round(train_data$Age)\n\ndata1$Age[is.na(data1$Age)]\u003c-predict(age_pred, data1)[is.na(data1$Age)]\ndata1$Age \u003c-round(data1$Age)\n\ntrain_data \u003c- data1[1:891,]\ntest_data \u003c- data1[892:1309,]\n\nset.seed(007)\nstr(train_data)\nmodel \u003c- randomForest(factor(Survived)~ Pclass+Sex+Age+SibSp+Parch+Fare+Embarked+Title+Family_size, data=train_data)\n\nmodel$importance\n\nplot(model)\n\n\nimportance \u003c- importance(model)\nVarImportance \u003c- data.frame(Variables=row.names(importance),\n                            Importance=round(importance[,\u0027MeanDecreaseGini\u0027],2))\n\n\nrank_importance \u003c- VarImportance %\u003e% mutate(Rank=paste0(\u0027#\u0027, dense_rank(desc(Importance))))\nrank_importance\n\nggplot(rank_importance, aes(x=reorder(Variables, Importance), y=Importance, fill=Importance ))+\n        geom_bar(stat = \u0027identity\u0027)+coord_flip()+geom_text(aes(x=Variables, label=Rank, y=5))+\n        labs(x=\u0027Variables\u0027)\n\n\n\n\n\n# Predict using the test set\nprediction \u003c- predict(model, test_data)\nsummary(prediction)\n# Save the solution to a dataframe with two columns: PassengerId and Survived (prediction)\nsolution \u003c- data.frame(PassengerID = test_data$PassengerId, Survived = prediction)\n\n# Write the solution to file\nwrite.csv(solution, file = \u0027test_solution2.csv\u0027, row.names = F)\n\n\n\n\n\n","dateCreated":"2016-07-23T08:07:44.36Z"},"kernelRun":{"id":307251,"kernelId":81210,"status":"complete","type":"batch","sourceType":"script","language":"r","title":"Titanic survival prediction","dateCreated":"2016-07-23T08:07:44.36Z","dateEvaluated":"2016-07-23T08:07:44.577Z","workerContainerPort":null,"workerUptimeSeconds":17615,"workerIPAddress":"10.0.0.6       ","scriptLanguageId":1,"scriptLanguageName":"R","renderedOutputUrl":null,"commit":{"id":7948280,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"script","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"\n# This R script will run on our backend. You can write arbitrary code here!\n\n# Many standard libraries are already installed, such as randomForest\nlibrary(randomForest)\nlibrary(dplyr)\nlibrary(ggplot2)\nlibrary(VIM)\nlibrary(stringr)\nlibrary(\u0022ggthemes\u0022)\nlibrary(\u0022randomForest\u0022)\nlibrary(\u0022ROCR\u0022)\nlibrary(\u0022mice\u0022)\nlibrary(\u0027scales\u0027)\n# The train and test data is stored in the ../input directory\ntrain \u003c- read.csv(\u0022../input/train.csv\u0022, stringsAsFactors=F)\ntest  \u003c- read.csv(\u0022../input/test.csv\u0022, stringsAsFactors=F)\n\nglimpse(train)\nglimpse(test)\n\n#############################\n#When column-binding, rows are matched by position,\n#not value so all data frames must have the same number of rows.\n#To match by value, not position, see left_join etc. When row-binding,\n#columns are matched by name, and any values that don\u0027t \n#match will be filled with NA\n##############################\n\ndata1\u003c-bind_rows(train, test)\n\n##data1$Survived[is.na(data1$Survived)]\u003c-0\n\nvisual_na\u003c- aggr(data1, numbers=TRUE, labels=names(data1),cex.axis=.5, cex.numbers=.5, sortVars=T)\n\n##############\n#ok there is lot of NA in Cabin \u0026 Deck\n#whats going on\n##############\n\ndata1$Cabin[data1$Cabin==\u0027\u0027]\u003c-NA\nsum(is.na(data1$Cabin))\n\nstr(data1)\n\n#############\n#So we given 0 for all test$Survived\n#meaning they are all dead\n###############\n\n#############\n#ok lets tackkle names\n#I find 2 things interest\n#their surname \u0026\n#their title\n##############\n\n#############\n#ok first lets extract\n#title from their names\n#############\n\n\ndata1$Title \u003c- gsub(\u0027(.*,)|(\\\\..*)\u0027, \u0027\u0027, data1$Name)\ndata1$Title\u003c-str_trim(data1$Title)\n\ndistinct(data1, Title)\n\n################\n#Ok we have 19 distinct Titles\n################\n\ndata1$Title \u003c- gsub(\u0027Ms\u0027, \u0027Miss\u0027, data1$Title, ignore.case = T)\n\ndata1$Title \u003c- gsub(\u0027Mlle\u0027, \u0027Miss\u0027, data1$Title, ignore.case = T)\n\nno_title \u003c- c(\u0027Master\u0027, \u0027Don\u0027, \u0027Rev\u0027, \u0027Dr\u0027, \u0027Mme\u0027, \u0027Major\u0027, \u0027Lady\u0027, \u0027Sir\u0027, \u0027Col\u0027, \u0027Capt\u0027, \u0027the Countess\u0027, \u0027Jonkheer\u0027, \u0027Dona\u0027)\n\ndata1$Title[data1$Title %in% no_title]\u003c-\u0027No Title\u0027\n\ndistinct(data1, Title)\n####################\n#ok we have now only 4\n#titles\n###################\n\ndata1$Surname \u003c- sapply(data1$Name, function(x) strsplit(x,\u0027[,.]\u0027 )[[1]][1])\n\n#################\n#lets sort out guy without fare\n#since only 1 person in all data with no fare\n#################\n\n\nfilter(data1, is.na(Fare))\n\n\n\nstr(data1)\n\ndata1$Cabin_class \u003c- sapply(data1$Cabin, function(x) substr(x, 1,1)[[1]][1])\n\n#################\n#this dude has fare value missing but we know he has Pclass 3 \u0026\n# Embarked from S\n################\n\ndistinct(data1, Embarked)\n\n#################################\n#Hist doest work; \n###ggplot(filter(data1, Pclass==3 \u0026 Embarked==\u0027S\u0027), aes(Fare))+geom_histogram(bins=20, na.rm = T)+\n ##       geom_vline(aes(xintercept=mean(Fare, na.rm=T)))+\n ###       scale_x_continuous(labels=dollar_format())\n#####################################\n\nggplot(filter(data1, Pclass==3 \u0026 Embarked==\u0027S\u0027), aes(Fare))+\n        geom_density(fill=\u0027green\u0027, alpha=.5)+\n        scale_x_continuous(labels=dollar_format(),breaks = c(0,10,20,30,40,50,60,70))+\n        geom_vline(aes(xintercept=median(Fare, na.rm=TRUE)), color=\u0027red\u0027, linetype=\u0027dashed\u0027)\n\ndata1[is.na(data1$Fare),]\n#####################\n# so now we can confirm row no. 1044 matches passenger ID\n#so safe to use code below\n####################\n\ndata1[is.na(data1$Fare),]$Fare\u003c- median(data1[data1$Pclass==3 \u0026 data1$Embarked==\u0027S\u0027,]$Fare, na.rm=TRUE)\n\ndata1[1044,]\n\nsum(is.na(data1$Embarked))\nglimpse(data1)\nsummary(as.factor(data1$Embarked))\n\n#####################\n#I should have made empty cells all NA in the beginning\n# anyways here we go\n######################\n\ndata1[data1==\u0027\u0027] \u003c-NA\n\n#####################\n#Now we can clearly see NAs in Embarked\n####################\n\nfilter(data1, is.na(Embarked))\n\n######################\n#2 girls with no Embarked value but they have Fare and Cabin_class common\n#####################\n\nggplot(data1, aes(Embarked, Fare))+geom_boxplot()+geom_hline(aes(yintercept=80), col=\u0022red\u0022, linetype= \u0027dashed\u0027, lwd=.5)+\n        facet_grid(~Pclass)+theme_bw()\n\nmedian(data1[data1$Embarked==\u0027C\u0027 \u0026 data1$Pclass==1,]$Fare, na.rm = T)\n\n###################\n# the median Fare for people with Pclass 1 with Embarked C is $77 which is close to what\n# those two girls payed \n#based on those estimates I think they embarked from C\n###################\n\ndata1[data1$PassengerId==62 | data1$PassengerId==830,]$Embarked\u003c- \u0027C\u0027\ndata1[data1$PassengerId==62 | data1$PassengerId==830,]\n\n\n\n########################\n#lets look at family size\n#sibsp           Number of Siblings/Spouses Aboard\n#parch           Number of Parents/Children Aboard\n#so combing those 2 will give us family size\n#########################\n\ndata1$Family_size \u003c-data1$SibSp+data1$Parch+1\n\n\n#######################\n#now we got many Age with NA almost 20 % of all age\n#\u0026 lots of Cabin_class with NAs\n# we need strong statistical inference method to predict those values\n##########################\n\n\n##all age variable from test data only\n\nstr(data1)\n\ndata1$Sex \u003c- as.factor(data1$Sex)\ndata1$Ticket \u003c-as.factor(data1$Ticket)\ndata1$Title \u003c-as.factor(data1$Title)\ndata1$Embarked \u003c-as.factor(data1$Embarked)\ndata1$Survived \u003c-as.factor(data1$Survived)\ndata1$Pclass \u003c-as.factor(data1$Pclass)\ndata1$Family_size \u003c-as.factor(data1$Family_size)\n################################\n####library(help=\u0022datasets\u0022) \n#see all inbuilt datasets for future reference\n#################################\n\n\n\n############################################################################################\n\n#train_data \u003c- data1[1:891,]\n#test_data \u003c- data1[892:1309,]\n#test_data$Survived\u003c-NA\n\n###################\n\n\n##########################################################################################\n\nsum(is.na(data1$Age))\n##263 NAs \n\n################# ariables, label=Rank, y=5))+\n        labs(x=\u0027Variables\u0027)\n\n\n\n\n\n# Predict using the test set\nprediction \u003c- predict(model, test_data)\nsummary(prediction)\n# Save the solution to a dataframe with two columns: PassengerId and Survived (prediction)\nsolution \u003c- data.frame(PassengerID = test_data$PassengerId, Survived = prediction)\n\n# Write the solution to file\nwrite.csv(solution, file = \u0027test_solution2.csv\u0027, row.names = F)\n\n\n\n\n\n","dateCreated":"2016-07-23T08:07:44.36Z"},"resources":null,"isolatorResults":"\u003cresults\u003e\u003csucceeded\u003eTrue\u003c/succeeded\u003e\u003cdisk_kb_free\u003e472700\u003c/disk_kb_free\u003e\u003cfailure_message /\u003e\u003cused_all_space\u003eFalse\u003c/used_all_space\u003e\u003ctimeout_exceeded\u003eFalse\u003c/timeout_exceeded\u003e\u003cdocker_image_name\u003ekaggle/rstats\u003c/docker_image_name\u003e\u003crun_time_seconds\u003e30.9760990142822\u003c/run_time_seconds\u003e\u003cdocker_image_id\u003e3d52fffaeb0c229470c61b3b06d5b526404f0a0f954dda22adbd03ac6b4f794d\u003c/docker_image_id\u003e\u003cexit_code\u003e0\u003c/exit_code\u003e\u003c/results\u003e","runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageDigest":null,"dockerImageId":"3d52fffaeb0c229470c61b3b06d5b526404f0a0f954dda22adbd03ac6b4f794d","dockerImageName":"kaggle/rstats","diskKbFree":472700,"failureMessage":"","exitCode":0,"queuedSeconds":0,"outputSizeBytes":0,"runTimeSeconds":30.9760990142822,"usedAllSpace":false,"timeoutExceeded":false,"isValidStatus":false,"wasGpuEnabled":false,"wasInternetEnabled":false,"outOfMemory":false,"invalidPathErrors":false,"succeeded":true,"wasKilled":false},"outputFilesTotalSizeBytes":132834,"dockerImageVersionId":null,"usedCustomDockerImage":false},"author":{"id":616369,"displayName":"Scottish Chemjong","email":null,"editedEmail":null,"editedEmailCode":null,"userName":"chemjon "info":null,"name":"Cabin","description":null},{"order":11,"originalType":"","type":"string","extendedType":null,"isNullable":false,"isPrimaryKey":false,"isLabel":false,"info":null,"name":"Embarked","description":"The port in which a passenger has embarked. C - Cherbourg, S - Southampton, Q = Queenstown"}],"totalRows":null,"type":"genericTable","collapsed":true,"info":{"metrics":null,"archiveInfo":null,"archiveInfoV2":null,"blobFileInfo":null,"convertCsvInfo":null,"kernelReference":null},"settings":{"csvSettings":null,"bigQuerySettings":null,"bigQueryMirrorSettings":null,"storageSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[],"name":"","description":null}],"name":"train.csv","description":"contains data \n"}],"name":"Titanic: Machine Learning from Disaster","description":"\u003ch3\u003eOverview\u003c/h3\u003e\n\u003cp\u003eThe data has been split into two groups:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003etraining set (train.csv)\u003c/li\u003e\n\u003cli\u003etest set (test.csv)\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cb\u003e The training set \u003c/b\u003eshould be used to build your machine learning models. For the training set, we provide the outcome (also known as the “ground truth”) for each passenger. Your model will be based on “features” like passengers’ gender and class. You can also use \u003ca href=\u0022https://triangleinequality.wordpress.com/2013/09/08/basic-feature-engineering-with-the-titanic-data/\u0022 target=\u0022_blank\u0022\u003e feature engineering \u003c/a\u003eto create new features.\u003c/p\u003e\n\u003cp\u003e\u003cb\u003eThe test set \u003c/b\u003eshould be used to see how well your model performs on unseen data. For the test set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancés were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, stepdaughter, stepson\u003cbr /\u003e Some children travelled only with a nanny, therefore parch=0 for them.\u003c/p\u003e"}],"versions":[{"id":307251,"kernelVersionId":null,"isForkParent":false,"isNotebook":false,"languageName":"R","lastRunTime":"2016-07-23T08:07:44.36Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":20,"linesInsertedFromPrevious":1,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"3d52fffaeb0c229470c61b3b06d5b526404f0a0f954dda22adbd03ac6b4f794d","dockerImageName":"kaggle/rstats","exitCode":0,"failureMessage":"","isValidStatus":true,"runTimeSeconds":30.9760990142822,"succeeded":true,"timeoutExceeded":false,"usedAllSpace":false},"status":"complete","title":"Titanic survival prediction","url":"/chemjong/titanic-survival-prediction?scriptVersionId=307251","versionNumber":3,"hasVersionNumber":true,"isRedacted":false,
